    ""nt},nt{ntt"key": "access_constraints",ntt"value": "["Use Constraints:
    Data are collected at the 1:100,000 scale and only on streams that are included
    in the PNW reach LLID-based routing system. Generally, this includes all named streams
    at the 1:100,000 scale and some unnamed tributaries. Smaller tributaries that are
    not included in this routing system are not shown in this coverage. This data represents
    believed instances of fish distribution or habitat that likely supports fish distribution,
    and as every stream has not been fully evaluated, this is not an all-inclusive list
    of fish distribution in this region. Each arc included in this coverage represents
    a stream segment of suitable habitat currently believed to be utilized by wild,
    natural, and/or hatchery fish populations and/or streams where sightings of wild,
